import {Grid,Cell} from 'react-mdl';
class Contact extends Component{
    render(){
        return(
            <div className="contact-body">
            <Grid className="contact-grid">
                <Cell cols={6}>
                    <h2 style={{color:'white'}}>PRERIT KHANDELWAL</h2>
                    <img src="https://d39qdlcrvnra4b.cloudfront.net/avatars/1605846/original/avatar.png?1559039487"
                    alt="avatar-pic"
                    style={{height:'250px'}}
                    />
                    <p style={{width:'75%', margin:'auto', paddingTop:'2em',color:'white',fontSize:'14px'}}>Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry's standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book.</p>
                </Cell>
                <Cell cols={6}>
                <h2 style={{color:'white'}}>Contact Me</h2>
                </Cell>
            </Grid>
            </div>
        );
    }
}

export default Contact;
